import React from "react";
import wave from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/waving-hand.png";
import flag_ca from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/flag-canada_.png";
import CommonParent from "./CommonParent";
import web from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/spaceship.gif";
const Home = (props) => {
  return (
    <div id="home" className=" #home">
      <CommonParent
        name={
          <p>
            Hello! <img height="30" width="30" src={wave} /> <br /> My name is
            Maah Asghar. <br /> I am a Software Engineer based in <br />
            London, Ontario, Canada <img height="30" width="30" src={flag_ca} />
          </p>
        }
        text={
          <p>
            I am a Software Engineer <br /> based in <br />
            London, Ontario, Canada <img src={flag_ca} />
          </p>
        }
        imgsrc={web}
        visit="/projects"
        btname="View Projects"
      />

      {/* <CommonParent
        name="Hello! my name is "
        imgsrc={web}
        visit="/projects"
        btname="View Projects"
      /> */}
    </div>
  );
};

export default Home;
